import "./navbar.css";

function Navbar(){
return (
    <>
        <nav>
            <a href="index.html">
                <img src="./logo.svg" alt="Logo"></img>
            </a>


            <div>
                <ul className="navbar">
                    <li><a href="index.html">Trang chủ</a></li>
                    <li><a href="index.html">CTXH</a></li>
                    <li><a href="index.html">Nhóm môn học</a></li>
                    <li><a href="index.html">Đăng nhập</a></li>
                </ul>
            </div>
        </nav>
    </>
);
}



export default Navbar;
